    <div className="work">
      <h1> Works</h1>

      <div className="projects">
      <ul class="cards">
        <li class="card">
            <h2>CARDVIEW</h2>
          </li>
          <li className="card">
          <h2>CARDVIEW</h2>
          </li>
          <li className="card">
          <h2>CARDVIEW</h2>
          </li>
          </ul>
    </div>
    </div>
  );
}

export default JobLists;
